// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import BloodDonationList from './components/BloodDonationList';
import Home from './components/Home'; // Ensure you have a Home component or any other component

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/BloodDonation/users" component={BloodDonationList} />
        <Route path="/" exact component={Home} />
        {/* Add other routes as needed */}
      </Switch>
    </Router>
  );
}

export default App;
